CREATE TABLE `tme` (
  `id` int(11) NOT NULL auto_increment,
  `kdy` datetime default NULL COMMENT 'Den a čas.',
  `teplota` float default NULL COMMENT 'Nameřená teplota ve stupních Celsia.',
  `vlhkost` float default NULL COMMENT 'Naměřená vlhkost.',
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM;

ALTER TABLE `tme` ADD INDEX `kdy` (`kdy`);

CREATE TABLE `tme_cache` (
  `id` int(11) NOT NULL auto_increment,
  `kdy` datetime default NULL COMMENT 'Den a čas.',
